import React from "react";
import { useState } from "react";
const App = () => {
  const [num, setNum] = useState(0);


  

  return (
    <>
      <button
        onClick={() => {
          setNum(num + 1);
        },()=>{
          alert('i am clicked');
        }}
      >
        Click me {num}
      </button>
    </>
  );
};

export default App;
